        cheese: 1,
        bacon: 2,
        onion: 1
    }
    componentDidMount () {
        console.log(this.state)
    }
    render () {
        return(
            <div>
                <CheckoutSummary ingredients={this.state.ingredients}/>
            </div>
        );
    }
}

export default Checkout;
